import * as React from 'react';
import Experience from './Pages/Experience'
import { BrowserRouter, Routes, Route } from "react-router-dom";

import { About } from './Pages/About/About'
import { TopBar } from './Composistions/TopBar/TopBar'

import { ThemeProvider } from '@mui/material';
import { createTheme } from '@mui/material';
import { themeOptions } from './theme'

import './App.css'

function App() {
  const [mode, setMode] = React.useState('dark');
  const theme = createTheme(themeOptions(mode))

  return (

    <div className="App">
      <ThemeProvider theme={theme}>
        <header className="App-header">
          <TopBar themeOptions={theme} setMode={setMode}></TopBar>
          <BrowserRouter>
            <Routes>
              <Route path="/" element={<TopBar themeOptions={theme} setMode={setMode}></TopBar>}>
                <Route index element={<Home />} />
                <Route path="blogs" element={<Blogs />} />
                <Route path="contact" element={<Contact />} />
                <Route path="*" element={<NoPage />} />
              </Route>
            </Routes>
          </BrowserRouter>
          <Experience/>
          <About />
        </header>
      </ThemeProvider>

    </div>
  );
}

export default App;
